import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import Navbar from "./Navbar";
import { googleLogout } from "@react-oauth/google";
import '../App.css'

function Common() {
  let navigate = useNavigate();
  const [image, setImage] = useState('');
  let count = 1;

  const logout = () => {
    googleLogout({});
    navigate("/")
  };

  const goToAprcl = () => {
    navigate("/aprcl");
  };

  const goToGoal = () => {
    navigate("/goal");
  }
  const getGraph=async ()=>{
    if(count === 1) {
      const data={
        "rating":3,
        "goals":4
      }
      const resp= await fetch('http://127.0.0.1:5000/graph/growth',{
        method:'POST',
        body:JSON.stringify(data),
        headers: {
          'Content-Type': 'application/json',
        }
      })
      const blobdata=await resp.blob()
      const url=URL.createObjectURL(blobdata)
      // console.log(url);
      setImage(url);
      count = 2;
      console.log(count);
    }
  }

  return (
    <div  onLoad={getGraph}>
      <div className="header">
      <div>
        <Link to="https://divum.in/" target="_blank">
          <img
            src="https://content.jdmagicbox.com/comp/bangalore/23/080p3033723/catalogue/divum-corportate-services-pvt-ltd-domlur-bangalore-computer-software-developers-0fdbsyb7ib-250.jpg"
            alt="divum-logo" 
            className="img-logo"
          />
        </Link>
      </div>
      <div className="nav">
        <Navbar />
      </div>
      <div>
        <button onClick={logout} className="logout">Log out</button>
      </div>
      <button onClick={goToAprcl} className="link A">Form </button>
      <button onClick={goToGoal} className="link B">Set Goal</button>
      </div>
      <img src={image}/>
    </div>
  );
}

export default Common;
